booking_extra as ( SELECT
            ber.extra_requirement_id, ber.extra_service as booking_extra_requirements_name
        FROM
            dlvr-prod-bigdata.datamart_cs.bookings_extra_requirements_en ber
      WHERE ber.booking_id = {{table1.selectedRow.data.booking_id}}
    ) 
,drivers_type1 AS (
    SELECT
        DISTINCT "Type I" as driver_type,
        d.id as driver_id,
         CASE
                WHEN 
                    d.country_code = 'PH' 
                THEN 
                    DATETIME(d.updated_at,"Asia/Manila") 
                ELSE
                    DATETIME(d.updated_at,"Asia/Bangkok") 
            END AS arrival_time_at_driver_location,
        d.last_known_position_lat AS driver_lat,
        d.last_known_position_lng AS driver_long,
        ABS(DATETIME_DIFF(CAST({{table1.selectedRow.data.pickup_time}} AS DATETIME),
        CASE
                WHEN 
                    d.country_code = 'PH' 
                THEN 
                    DATETIME(d.updated_at,"Asia/Manila") 
                ELSE
                    DATETIME(d.updated_at,"Asia/Bangkok") 
            END, MINUTE)) as remaining_time,

        ST_DISTANCE(
            ST_GEOGPOINT(
                {{table1.selectedRow.data.pickup_lng}},
                {{table1.selectedRow.data.pickup_lat}}
            ),
            ST_GEOGPOINT(
                d.last_known_position_lng,
                d.last_known_position_lat
            )
        ) as distance_from_driver_to_pickup
    FROM
        `datamart_cs.drivers` d
),
drivers_type2 AS (
    SELECT
        DISTINCT "Type II" as driver_type,
        et.driver_id,
        CASE
            WHEN 'PH' = 'PH' AND worst_case_eta IS NOT NULL THEN DATETIME(worst_case_eta,"Asia/Manila") 
            WHEN worst_case_eta IS NOT NULL THEN DATETIME(worst_case_eta,"Asia/Bangkok") 
            WHEN 'PH' = 'PH' THEN DATETIME(eta,"Asia/Manila") 
            ELSE DATETIME(eta,"Asia/Bangkok") 
        END AS arrival_time_at_driver_location,
        l.dropoff_lat AS driver_lat,
        l.dropoff_lng AS driver_long,
        ABS(DATETIME_DIFF(          
            CAST({{table1.selectedRow.data.pickup_time}}  AS DATETIME),
                CASE
                    WHEN 'PH' = 'PH' AND worst_case_eta IS NOT NULL THEN DATETIME(worst_case_eta,"Asia/Manila") 
                    WHEN worst_case_eta IS NOT NULL THEN DATETIME(worst_case_eta,"Asia/Bangkok") 
                    WHEN 'PH' = 'PH' THEN DATETIME(eta,"Asia/Manila") 
                    ELSE DATETIME(eta,"Asia/Bangkok") 
                END,
                MINUTE
            )
        ) as remaining_time,
           ST_DISTANCE(
            ST_GEOGPOINT(
                {{table1.selectedRow.data.pickup_lng}},
                {{table1.selectedRow.data.pickup_lat}}
            ),
            ST_GEOGPOINT(l.dropoff_lng, l.dropoff_lat)
        ) as distance_from_driver_to_pickup      

    FROM
        (
            SELECT
                *,
                ROW_NUMBER() OVER (
                    PARTITION BY et.driver_id
                    ORDER BY
                        et.eta DESC
                ) as eta_order
            FROM
                `prod_dwh.estimate_transit_times_v` et
        ) et
        JOIN (
            SELECT 
                booking_id,
                latitude as dropoff_lat,
                longitude as dropoff_lng
            FROM
                `datamart_cs.locations` l 
            WHERE
                l.deleted_at IS NULL
                AND (
                    latitude BETWEEN -90
                    AND 90
                )
                AND (
                    longitude BETWEEN -180
                    AND 180
                )
            QUALIFY ROW_NUMBER() OVER (PARTITION BY booking_id ORDER BY created_at DESC) = 1
        ) l ON et.booking_id = l.booking_id
        AND et.eta_order = 1
    WHERE
        et.driver_id IS NOT NULL
        AND et.eta IS NOT NULL
),
drivers_type3 AS (
    SELECT
        DISTINCT "Type III" as driver_type,
        d.driver_id,
        DATETIME_ADD(
            DATETIME(
                DATE(
                   CAST({{table1.selectedRow.data.pickup_time}} AS DATETIME)
                )
            ),
            INTERVAL `hour` HOUR
        ) AS arrival_time_at_driver_location,
        d.lat AS driver_lat,
        d.lng AS driver_long,
        ABS(
            DATETIME_DIFF(
                CAST({{table1.selectedRow.data.pickup_time}} AS DATETIME),
                DATETIME_ADD(
                    DATETIME(
                        DATE(
                        CAST({{table1.selectedRow.data.pickup_time}} AS DATETIME)
                        )
                    ),
                    INTERVAL `hour` HOUR
                ),
                MINUTE
            )
        ) as remaining_time,
        ST_DISTANCE(
            ST_GEOGPOINT(
                {{table1.selectedRow.data.pickup_lng}},
                {{table1.selectedRow.data.pickup_lat}}
            ),
            ST_GEOGPOINT(d.lng, d.lat)
        ) as distance_from_driver_to_pickup
    FROM
        `dlvr-prod-bigdata.prod_ai_datamart.driver_route_prediction_v` d
),
tmp AS (
    SELECT
        ld.driver_type,
        d.country_code,
        d.id as driver_id,
        d.driver_name,
        d.driver_phone,
        CASE
            WHEN d.fleet_partner_id IS NOT NULL THEN "Fleet_partner"
            ELSE "Non_fleet_partner"
        END AS fleet_partner,
        CASE
            d.online_status
            WHEN 0 THEN 'Offline'
            WHEN 1 THEN CASE
                WHEN b.id IS NOT NULL
                AND b.status = 2
                AND b.time_type = 1 THEN 'Online_Acepted_Immediate'
                WHEN b.id IS NOT NULL
                AND b.status = 2
                AND b.time_type = 2
                AND (
                    (
                        TIMESTAMP_DIFF(b.pickup_time, CURRENT_TIMESTAMP, SECOND) / 60
                    ) <= vt.blocked_period_before * 60
                )
                AND (
                    (
                        TIMESTAMP_DIFF(b.pickup_time, CURRENT_TIMESTAMP, SECOND) / 60
                    ) >= 0
                ) THEN 'Online_Acepted_Scheduled'
                WHEN b.id IS NOT NULL
                AND b.status = 2
                AND b.time_type = 3
                AND (
                    (
                        TIMESTAMP_DIFF(b.pickup_time, CURRENT_TIMESTAMP, SECOND) / 60
                    ) <= vt.blocked_period_before * 60
                )
                AND (
                    (
                        TIMESTAMP_DIFF(b.pickup_time, CURRENT_TIMESTAMP, SECOND) / 60
                    ) >= 0
                ) THEN 'Online_Acepted_Fullday'
                WHEN b.id IS NOT NULL
                AND b.status = 2
                AND b.time_type = 4
                AND (
                    (
                        TIMESTAMP_DIFF(b.pickup_time, CURRENT_TIMESTAMP, SECOND) / 60
                    ) <= vt.blocked_period_before * 60
                )
                AND (
                    (
                        TIMESTAMP_DIFF(b.pickup_time, CURRENT_TIMESTAMP, SECOND) / 60
                    ) >= 0
                ) THEN 'Online_Acepted_Fixed_Price_Route'
                WHEN b.id IS NOT NULL
                AND b.status = 3 THEN 'Online_In_Progress'
                WHEN d.is_available = FALSE THEN 'Online_Busy'
                ELSE 'Online_Free'
            END
            WHEN 2 THEN 'Online_Busy'
            WHEN 3 THEN 'Online_In_Progress'
            WHEN 4 THEN 'Online_Accepted_Immediate'
            WHEN 5 THEN 'Online_Accepted_Scheduled'
        END AS online_status,
        CASE
            WHEN d.fleet_partner_id IS NULL THEN p.vehicle_type_id
            WHEN d.fleet_partner_id IS NOT NULL THEN fpv.vehicle_type_id
        END AS vehicle_type_id,
        vae.vehicle_type,
        vae.area_id,
        driver_lat,
        driver_long,
        distance_from_driver_to_pickup,
        ld.arrival_time_at_driver_location,
        remaining_time,
        CASE
            WHEN remaining_time > 0 THEN round(
                (distance_from_driver_to_pickup / 1000) /(remaining_time / 60),
                2
            )
            ELSE null
        END as speed,
        d.extra_service_ids,
        d.extra_service as extra_service_name
    FROM
        `datamart_cs.drivers` d
        JOIN (
            SELECT
                *
            FROM
                drivers_type1
            WHERE driver_type in ({{select33.value}})
            UNION
            ALL
            SELECT
                *
            FROM
                drivers_type2
            WHERE driver_type in ({{select33.value}})
            UNION
            ALL
            SELECT
                *
            FROM
                drivers_type3
            WHERE driver_type in ({{select33.value}})

        ) ld ON d.id = ld.driver_id
        LEFT JOIN `datamart_cs.bookings` b ON b.driver_id = d.id
        AND b.status = 2
        AND (LOWER(b.note) NOT LIKE '%testdriver%')
        AND b.deleted_at IS NULL
        AND (
            b.time_type = 1
            OR (
                b.time_type = 2
                AND (
                    (
                        timestamp_diff(b.pickup_time, CURRENT_TIMESTAMP, SECOND)
                    ) / 60 <= 2 * 60
                )
            )
            OR (
                b.time_type = 3
                AND (
                    (
                        timestamp_diff(b.pickup_time, CURRENT_TIMESTAMP, SECOND)
                    ) / 60 <= 2 * 60
                )
            )
            OR (
                b.time_type = 4
                AND (
                    (
                        timestamp_diff(b.pickup_time, CURRENT_TIMESTAMP, SECOND)
                    ) / 60 <= 2 * 60
                )
            )
