, volume as (
    SELECT
        d.country_code,
        b.driver_id,
        CASE
            WHEN lower(d.country_code) = 'ph' THEN DATE(d.approved_date, "Asia/Manila")
            WHEN lower(d.country_code) = 'th' THEN DATE(d.approved_date, "Asia/Bangkok")
            ELSE DATE(d.approved_date, "Asia/Jakarta")
        END as activation_date,
        COUNT(
            CASE
                WHEN (
                    DATE(b.pickup_time) BETWEEN (CURRENT_DATE() - 7)
                    AND CURRENT_DATE()
                ) THEN b.id
                ELSE NULL
            END
        ) as volume_7,
        COUNT(
            CASE
                WHEN (
                    DATE(b.pickup_time) BETWEEN (CURRENT_DATE() - 14)
                    AND CURRENT_DATE()
                ) THEN b.id
                ELSE NULL
            END
        ) as volume_14,
        COUNT(
            CASE
                WHEN (
                    DATE(b.pickup_time) BETWEEN (CURRENT_DATE() - 30)
                    AND CURRENT_DATE()
                ) THEN b.id
                ELSE NULL
            END
        ) as volume_30,
        COUNT(b.id) as volume_lifetime
    FROM
        datamart_cs.bookings b 
    JOIN datamart_cs.drivers d ON b.driver_id = d.id
    WHERE
        1 = 1 -- fp.id is not null
        AND b.status = 4 
    GROUP BY
        1,
        2,
        3
),
extra_requirement_match as (
    SELECT
        tmp.country_code,
        driver_type,
        tmp.driver_id,
        driver_name,
        driver_phone,
        fleet_partner,
        online_status,
        vehicle_type_id,
        vehicle_type,
        area_id,
        volume_7, 
        volume_14,
        volume_30,
        volume_lifetime,
        CASE
            WHEN DATE_DIFF(CURRENT_DATE(), activation_date, DAY) <= 30 THEN "Newly Onboarded"
            WHEN volume_7 >= 1 THEN "Active 7 Days"
            WHEN volume_14 >= 1 THEN "Active 14 Days"
            WHEN volume_30 >= 1 THEN "Active 30"
            WHEN volume_30 = 0
            AND volume_lifetime >= 1 THEN "Inactive 30 Days"
            WHEN volume_lifetime = 0 THEN "Inactive 0 Bookings"
            ELSE Null
        END as booking_activity,
        ST_X(
            ST_CENTROID_AGG(ST_GEOGPOINT(driver_long, driver_lat))
        ) as driver_long,
        ST_Y(
            ST_CENTROID_AGG(ST_GEOGPOINT(driver_long, driver_lat))
        ) as driver_lat,
        home_long,
        home_lat,
        MAX(arrival_time_at_driver_location) as arrival_time_at_driver_location,
        MIN(remaining_time) as remaining_time,
        ROUND(AVG(distance_from_driver_to_pickup / 1000), 2) as distance_from_driver_to_pickup,
        ROUND(AVG(distance_from_home_to_dropoff / 1000), 2) as distance_from_home_to_dropoff,
        ROUND(AVG(speed), 2) as speed,
        extra_service_ids,
        extra_service_name
    FROM
        tmp
    LEFT JOIN volume v
    ON tmp.driver_id = v.driver_id
    WHERE
        (
            speed BETWEEN 0
            AND 180
        )
        AND vehicle_type_id is not null 
    GROUP BY
        tmp.country_code,
        driver_type,
        tmp.driver_id,
        driver_name,
        driver_phone,
        fleet_partner,
        online_status,
        vehicle_type_id,
        vehicle_type,
        area_id,
        volume_7, 
        volume_14,
        volume_30,
        volume_lifetime,
        extra_service_ids,
        extra_service_name,
        home_long,
        home_lat,
        CASE
            WHEN DATE_DIFF(CURRENT_DATE(), activation_date, DAY) <= 30 THEN "Newly Onboarded"
            WHEN volume_7 >= 1 THEN "Active 7 Days"
            WHEN volume_14 >= 1 THEN "Active 14 Days"
            WHEN volume_30 >= 1 THEN "Active 30"
            WHEN volume_30 = 0
            AND volume_lifetime >= 1 THEN "Inactive 30 Days"
            WHEN volume_lifetime = 0 THEN "Inactive 0 Bookings"
            ELSE Null
        END
)

, driver_extra_filter as (
SELECT
DISTINCT
    country_code,
    driver_type,
    driver_id,
    driver_name,
    driver_phone,
    fleet_partner,
    online_status,
    vehicle_type_id,
    vehicle_type,
    area_id,
    volume_7, 
    volume_14,
    volume_30,
    volume_lifetime,
    booking_activity,
    CONCAT(driver_long, ', ', driver_lat) as driver_location,
    CONCAT(home_long, ', ', home_lat) as home_location, 
    arrival_time_at_driver_location,
    remaining_time,
    distance_from_driver_to_pickup,
    distance_from_home_to_dropoff,
    speed,
    extra_service_ids,
    extra_service_name

FROM
    extra_requirement_match de
    CROSS JOIN (
WITH x as (select split(trim('[{{select37.value}}]', '[]')) as extra_requirement_name)
SELECT extra_requirement_name FROM x, x.extra_requirement_name
    ) be
WHERE 1=1
GROUP BY
    country_code,
    driver_type,
    driver_id,
    driver_name,
    driver_phone,
    fleet_partner,
    online_status,
    vehicle_type_id,
    vehicle_type,
    area_id,
    volume_7, 
    volume_14,
    volume_30,
    volume_lifetime,
    booking_activity,
    driver_long,
