    remaining_time,
    distance_from_driver_to_pickup,
    distance_from_home_to_dropoff,
    speed,
    extra_service_ids,
    extra_service_name
HAVING 
CASE WHEN '{{switch2.customValidation}}' = 'Yes' THEN 1 =1 ELSE

